//显示卡片面板
function showpanle(id, type) {
    switch (type) {
        case "add":
            var value = $('#u16_input').val()
            if (value != null && value != '') {
                top.db.transaction(function (tx) {
                    tx.executeSql("select * from CARD where code = ?", [value.toString()], function (tx, result) {
                        console.log(result);
                        if (result.rows.length > 0) {
                            resetpanle()
                            openpanle()
                            $("#u151").get(0).attributes['data-id'].value = result.rows[0].id
                            $("#u158_input").text(result.rows[0].code)
                            $("#u154_img").get(0).src = !!result.rows[0].img ? result.rows[0].img : top.defaultCard()
                            $("#u160_input").val(result.rows[0].name)
                            $("#u162_input").val(result.rows[0].quota)
                            $("input:radio[name=type]").each(function (i, r) {
                                if (r.value == result.rows[0].type) r.checked = true
                            })
                            $("#u163_div").val(result.rows[0].description)
                            $("#u151").get(0).attributes['data-time'].value = result.rows[0].createtime
                        } else {
                            resetpanle()
                            openpanle()
                            $("#u158_input").text(value)
                        }

                    }, function () {
                        console.info("数据加载异常！")
                    })
                })

            } else {
               // alert('请先输入卡片编码')
                func('请先输入卡片编码')
                focus()
                break
            }

            break
        case "show":
            getpanle(id)
            openpanle()
            break
        case "edit":
            getpanle(id)
            openpanle()
            break
    }
}


//弹框
// 创建一个div
var layer=document.createElement("div");
// 设置div的id值
layer.id="layer";
// 上面按钮点击事件
function func(date){
    /* 创建div的样式，宽200px,高80px，下面的是css样式居中，
     * css样式居中具体了解链接：https://blog.csdn.net/A_Bear/article/details/80546181
     */
    var style={
        background:"#6dcdff",
        position:"absolute",
        zIndex:10,
        width:"200px",
        height:"80px",
        left:"50%",
        top:"50%",
        marginLeft:"-100px",
        marginTop:"-40px",
        color:"#4d4e4f"
    }
    for(var i in style)
        layer.style[i]=style[i];

    // 当找不到id为layer的控件时
    if(document.getElementById("layer")==null){
        // 在body中添加layer控件（layer在上面创建的）
        document.body.appendChild(layer);
        // 设置显示类容
        layer.innerHTML=date;
        // 将div中文本居中
        layer.style.textAlign="center";
        layer.style.lineHeight="80px"; // 作用是调节字体行高与div同高，使其保持水平居中
        // 设置3s后去掉弹出窗
        setTimeout("document.body.removeChild(layer)",2000)
    }
}


//关闭面板
function closepanle() {
    $('#u16_input').val('')
    $("#u151").addClass("ax_default_hidden")
    $("#u151").get(0).style.visibility = "hidden"
    $("#u151").get(0).style.display = "none"
    openfoucs()
}

//打开面板
function openpanle() {
    $("#u151").removeClass("ax_default_hidden")
    $("#u151").get(0).style.visibility = "inherit"
    $("#u151").get(0).style.display = ""
    openfoucs()

}

//重置面板数据
function resetpanle() {
    $('#u154_img').get(0).src = top.defaultCard()
    $("#u151").get(0).attributes['data-id'].value = ""
    $("#u158_input").text("")
    $("#u160_input").val("")
    $("#u162_input").val("")
    $("input:radio[name=type]").each(function (i, r) {
        if (r.value == '1') r.checked = true
    })
    $("#u163_div").val("")
    $("#u151").get(0).attributes['data-time'].value = ""
}


//配置面板数据
function getpanle(id) {
    top.db.transaction(function (tx) {
        tx.executeSql("select * from CARD where id = ?", [id], function (tx, result) {
            $("#u151").get(0).attributes['data-id'].value = result.rows[0].id
            $("#u158_input").text(result.rows[0].code)
            $("#u154_img").get(0).src = !!result.rows[0].img ? result.rows[0].img : top.defaultCard()
            $("#u160_input").val(result.rows[0].name)
            $("#u162_input").val(result.rows[0].quota)
            $("input:radio[name=type]").each(function (i, r) {
                if (r.value == result.rows[0].type) r.checked = true
            })
            $("#u163_div").val(result.rows[0].description)
            $("#u151").get(0).attributes['data-time'].value = result.rows[0].createtime
        }, function () {
            console.info("数据加载异常！")
        })
    })
}

//保存面板数据
function savepanle() {
    //避免出现异常，全部采用字符串
    var id = $("#u151").get(0).attributes['data-id'].value + ''
    var code = $("#u158_input").text() + ''
    code = !!code ? code : (Date.now() + "")
    var img = $("#u154_img").get(0).src + ''
    var name = $("#u160_input").val() + ''
    var quota = $("#u162_input").val() + ''
    var type = $("input:radio:checked[name=type]").val() + ''
    var description = $("#u163_div").val() + ''
    var createtime = $("#u151").get(0).attributes['data-time'].value + ''
    //存在则修改，不存在则添加
    if (id) {
        updatepanle(id, code, img, name, quota, type, description, createtime)
    } else {
        addpanle(Date.now() + "", code, img, name, quota, type, description, Date.now() + "")
    }
}

//新增数据
function addpanle(id, code, img, name, quota, type, description, createtime) {
    top.db.transaction(function (tx) {
        tx.executeSql("insert into CARD values(?,?,?,?,?,?,?,?)", [id, code, img, name, quota, type, description, createtime], function (tx, result) {
            searchpanle($('#u16_input').val())
        }, function () {
            console.info("添加数据失败！")
        })
    })
    closepanle()
}

//修改数据
function updatepanle(id, code, img, name, quota, type, description, createtime) {
    top.db.transaction(function (tx) {
        tx.executeSql("update CARD set code=? ,img= ? ,name= ? ,quota= ? ,type= ? ,description= ? ,createtime= ? where id =? ",
            [code, img, name, quota, type, description, createtime, id], function (tx, result) {
                searchpanle($('#u16_input').val())
            }, function () {
                console.info("更新数据失败！")
            })
    })
    closepanle()
}

//删除数据
function delpanle(id) {
    top.db.transaction(function (tx) {
        tx.executeSql("delete from CARD where id =?", [id], function (tx, result) {
            searchpanle($('#u16_input').val());
        }, function () {
            console.info("删除卡片失败！")
        })
    })
}

//查询
function searchpanle(value) {
    top.db.transaction(function (tx) {
        tx.executeSql(!!value ? "select * from CARD where code like ? or name like ?" : "select * from CARD", !!value ? [value, value] : [], function (tx, result) {
            arrangepanle(result.rows)
        }, function () {
            console.log("数据加载失败！")
        });
    })
}

//排列
function arrangepanle(list) {
    $("#u12_div").empty()
    if (list != null && list.length > 0) {
        $.each(list, function (i, r) {
            var fieldset = ''
            fieldset += '<fieldset class="u18_div ax_default">'
            fieldset += '<legend class="ax_default link_button" >' + r.name + '</legend>'
            fieldset += '<div class="ax_default link_button u19 button" onclick="showpanle(\'' + r.id + '\',\'edit\')">'
            fieldset += '<div class="u19_div"></div>'
            fieldset += '<div class="text u19_text">'
            fieldset += '<p><span>设置</span></p>'
            fieldset += '</div>'
            fieldset += '</div>'
            fieldset += '<div  class="ax_default link_button u20 button" onclick="delpanle(\'' + r.id + '\')">'
            fieldset += '<div  class="u20_div"></div>'
            fieldset += '<div  class="text u20_text">'
            fieldset += '<p><span>删除</span></p>'
            fieldset += '</div>'
            fieldset += '</div>'
            fieldset += '<div  class="ax_default link_button u21 button" onclick="showpanle(\'' + r.id + '\',\'show\')">'
            fieldset += '<div  class="u21_div"></div>'
            fieldset += '<div  class="text u21_text">'
            fieldset += '<p><span>查看</span></p>'
            fieldset += '</div>'
            fieldset += '</div>'
            fieldset += '<div class="ax_default image u22">'
            fieldset += '<img  class="img u22_img" src="' + r.img + '"/>'
            fieldset += '</fieldset>'
            $("#u12_div").append(fieldset)
        })
    }
}

//输入框聚焦
function focus() {
    var inputBox = document.getElementById("u16_input");
    inputBox.focus();
}

//输入框失去焦点
function blur() {
    var inputBox = document.getElementById("u16_input");
    inputBox.blur();
}

function openfoucs() {
    var value = $("#u151").get(0).style.visibility
    if (value == 'hidden') {
        focus()
    } else if (value == 'inherit') {
        blur()
    }
}

function changeImg(e) {
    if (window.File && window.FileList && window.FileReader && window.Blob) {
        var reader = new FileReader();
        reader.onload = function (ev) {
            $("#u154_img").get(0).src = this.result;
        }
        //读取文件内容
        reader.readAsDataURL($(e).get(0).files[0]);
    } else {
        console.info("当前浏览器不支持文件读取器！")
    }
}

//导出
function tableToExcel() {
    var head = ['ID', '卡片编码', '图片', '卡片名称', '消费额度', '资金池', '描述', '创建时间'];
    var sql = 'select * from CARD';
    var fileName = '卡片管理'+(new Date()).toLocaleString()+'.xls';
    top.exportExcel(head, sql, fileName);
}

